import React from 'react'
import logo from '../../img/icon.png'
import styles from './Header.module.css'
import '../../App.css';

const Header = () => {
    return (
        <header className={styles.head}>
            <img className={styles.img} src={logo} alt="jopa"/>
        </header>
    );
}

export default Header;
